pragma solidity >=0.4.22 <0.9.0;

import "./Stock.sol";

contract User{
    //Stock public St;
    string _useraccount; //使用者學號
    uint dollars;


    struct UserInfoStruct{ //定義用戶數據結構
        string user_name; //使用者名稱
        string user_password; //使用者密碼
        uint user_dollars; //使用者帳戶餘額

        uint user_token;//使用者炒古幣
        uint user_stockvalue; //使用者股票價值
        uint user_RateOfReture; //使用者投資報酬率
        uint user_calltime;
    }
    /*
    constructor(address st)public{
        St=Stock(st);
    }
    */
    mapping(string=> UserInfoStruct) public person;

    bytes32[] public all_Useraccount; //所有使用者

    //使用者註冊
    function userCreate(string memory _useraccount,string memory user_name,string memory user_password)public{ 
        bytes32 bytes_useraccount;
        assembly{
            bytes_useraccount := mload(add(_useraccount,32))
        }
        bool user_state=true;
        for(uint i=0;i<all_Useraccount.length;i++){
            if(all_Useraccount[i]==bytes_useraccount){
                user_state=false;
            }
        }
        if(user_state==true){
            all_Useraccount.push(bytes_useraccount);
            person[_useraccount]=(UserInfoStruct(user_name,user_password,2000000,0,0,0,block.timestamp));
        }
    }    
    // 觀看註冊是否成功
    function get_User(string memory _useraccount,string memory user_password)public view returns(string memory){
        if(keccak256(abi.encodePacked(user_password))==keccak256(abi.encodePacked(person[_useraccount].user_password))){
            return "success";
        }
        else{
            return "fail";
        }
    }
    //判斷使用者是否存在
    function user_IsExist(string memory _useraccount) public view returns(bool){
        return bytes(person[_useraccount].user_name).length !=0;
    }

    //使用者登入登入
    function user_login(string memory _useraccount,string memory user_name,string memory user_password)public view returns(string memory){
        //使用者存在、密碼判斷
        bool exist=true;
        bool password_correct=true;

        if(keccak256(abi.encodePacked(user_name))!=keccak256(abi.encodePacked(person[_useraccount].user_name))){
            exist=false;
        }
        else if(keccak256(abi.encodePacked(user_password))!=keccak256(abi.encodePacked(person[_useraccount].user_password))){
            password_correct=false;
        }

        if(exist==true && password_correct==true){
            return "login success";
        }
        else if(exist==false){
            return "user not exit";
        }
        else if(exist==true && password_correct==false){
            return "password error";
        }
    }

    //取得使用者現在金額與炒股幣
    function user_get_money(string memory _useraccount) public  returns(uint){
        dollars=person[_useraccount].user_dollars;
        return dollars;
        //return (dollars,person[_useraccount].user_token);
    }

    //使用者金額更新
    function user_renew_money(string memory _useraccount,uint finalmoney) public {
        person[_useraccount].user_dollars=finalmoney;
    }

    //使用者發文炒股幣
    function user_addtoken(string memory _useraccount) public {
        person[_useraccount].user_token=person[_useraccount].user_token+1;
    }

    //取得使用者現在炒股幣數量
    function user_gettoken(string memory _useraccount) public view returns(uint){
        return person[_useraccount].user_token;
    }

    //取得使用者現在金額
     function user_now_money(string memory _useraccount) public view returns(uint){
        return person[_useraccount].user_dollars;
    }

    //取得使用者密碼
    function user_password(string memory _useraccount) public view returns(string memory){
            return person[_useraccount].user_password;
    }
}
